import React from "react";
import Swiper from "react-id-swiper";

import first from "./../img/polska.png";

const Autoplay = () => {
  const params = {
    spaceBetween: 30,
    centeredSlides: true,
    slidesPerView: 3,
    autoplay: {
      delay: 2500,
      disableOnInteraction: false,
    },
    pagination: {
      el: ".swiper-pagination",
      clickable: true,
    },
    navigation: {
      nextEl: ".swiper-button-next",
      prevEl: ".swiper-button-prev",
    },
  };
  return (
    <div className="clients containers">
      <Swiper {...params}>
        <div>
          <img src={first} />
        </div>
        <div>Slide #2</div>
        <div>Slide #3</div>
        <div>Slide #4</div>
        <div>Slide #5</div>
      </Swiper>
    </div>
  );
};
export default Autoplay;
